import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import Card from "./Card";
import cardsData from "./NewCard";

const cardComponents = cardsData.map(item => (
  <Card key={item.id} card={item} />
));

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    margin: "70px"
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
    backgroundColor: "orange"
  }
}));

export default function FullWidthGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper className={classes.paper} />
        </Grid>
        <Grid item xs={7} sm={3} md={14} lg={18}>
          {cardComponents.pop(1)}
        </Grid>
        <Grid item xs={6} sm={3} md={14} lg={18}>
          {cardComponents.pop(2)}
        </Grid>
        <Grid item xs={5} sm={3} md={14} lg={18}>
          {cardComponents.pop(3)}
        </Grid>
      </Grid>
    </div>
  );
}
